  certificateActions(type: boolean) {
    pdfMake.fonts = {
      NotoSans: {
        normal: "NotoSans-Regular.ttf",
        bold: "NotoSans-Bold.ttf",
        italics: "NotoSans-Regular.ttf",
        bolditalics: "NotoSans-Regular.ttf",
      },
    };
    this.createCertificate(this.certificate);
    const pdfDocGenerator = pdfMake.createPdf(this.certificateDoc);
    if (type) {
      pdfDocGenerator.download(this.certificate.certificate_number + ".pdf");
    } else {
      pdfDocGenerator.print();
    }
  }

  getBase64ImageFromURL(url: string): Observable<PictureData> {
    return Observable.create((observer: Observer<PictureData>) => {
      this._http
        .get(url, { responseType: "blob", observe: "response" })
        .pipe(retry(10))
        .subscribe(
          (resp) => {
            const reader: FileReader = new FileReader();
            reader.readAsDataURL(resp.body);
            reader.onloadend = function () {
              observer.next(
                new PictureData({
                  url: url,
                  data: reader.result,
                })
              );
              observer.complete();
            };
          },
          (err) => {
            toast({
              type: "error",
              title: err.name,
            });
          }
        );
    });
  }
